// @argument {Object} vector - defined by its x and y components.
// @returns {Number} magnitude
function getMagnitude() {
  var vector = arguments.length > 0 && arguments[0] !== undefined ? arguments[0] : {
    "x": 0,
    "y": 0
  };

  if (vector.x != 0 || vector.y != 0) {
